import React from 'react';
import './portfolio.scss';

const Portfolio = () =>{
    return (
        <>
        <dl className='flex-container'>
            <dt className='flex-items'>Project 1 <dd>This project 1 focuses on bla bla</dd></dt>
            
            <dt className='flex-items'>Project 2</dt>
            <dd>This project 2 focuses on bla bla</dd>
        </dl>
        </>
    )
};

export default Portfolio;
